INSERT INTO `management` (`ID`, `titel`, `article`, `datum`) VALUES
(6, 'Notulen algemene ledenvergadering, 29-04-2015', '<p><a href="http://www.dja-zundert.nl/bestuursmededelingen/Notulen%20ALV%202015.pdf">Klik hier voor de notulen.</a></p>', '2015-10-14 16:36:22'),
(7, 'Bestuursmededeling, juli 2015', '<p>Dag allemaal,</p><p>Graag deel ik met jullie allemaal een update van de bestuurstafel.</p><p>Wi-Fi op de DJA-accommodatie is in aantocht!</p><p>Deze week nemen we afscheid van Jan van den Broek als trainer. Na vele jaren van inzet gaat hij een stapje terug doen. We zijn bezig met verdere uitbreiding van de recreantentrainers om de huidige trainers te ondersteunen.</p><p>Ook onze Janus Hereijgers doet een heel klein stapje terug. Janus, een van onze ereleden, geeft het stokje van de schoolatletiek over aan Piet Nooren. Janus bedankt voor al die jaren inzet!! Janus blijft natuurlijk bij vele andere zaken betrokken!&nbsp;</p><p>We hebben de beschikking gekregen over een caravan. De DJA-caravan gaat gebruikt worden voor de ET zodat de apparatuur en de jury van de ET droog en comfortabel zitten.</p><p>Ja hoor het gaat nu echt gebeuren! Er komt een nieuwe website aan! Na een valse start vorig jaar hebben we nu een prachtige testomgeving staan. De verwachting is dat we er na de zomer mee live gaan. De nieuwe website behoudt alle content van de oude, maar zal wat interactiever worden dan de huidige.</p><p>We zien nog steeds dat het talentenprogramma de vruchten afwerpt. We zien positieve resultaten en horen positieve feedback over de hele breedte. We gaan ermee door zolang ons jeugdtrainersgilde het ook vol blijft houden en het tijd-technisch haalbaar is. Ook hier blijven we op zoek naar (hulp) trainers. Meld je alsjeblieft bij ons aan als je interesse hebt tegen een kleine vergoeding om de jeugd te trainen!</p><p>In de vacaturebank zijn we verder op zoek naar leden / ouders die ons willen helpen met het verbeteren van ons sponsoringplan, het opstellen van een menu waaruit sponsors hun sponsorpakket voor DJA kunnen kiezen, het beter benutten van reclameruimte op borden rond de baan en zichtbaarheid op de nieuwe website. Heb je nog een paar uurtjes beschikbaar per maand en wil je ons als bestuur best helpen mail dan even naar&nbsp;<a href="mailto:voorzitter@dja-zundert.nl">voorzitter@dja-zundert.nl</a>. Ook als je interesse hebt om mee te helpen in de kantine of een rol wilt spelen in de ARWB. Alvast bedankt!</p><p>Er is een flink aantal clubrecords gesneuveld in de laatste maanden. Er is een discussie rond het toekennen van records in hogere categorieën. De richtlijn is, net als bij de AU, dat clubrecords alleen in eigen categorie worden toegekend en niet daarboven. Dit heeft te maken met het feit dat het vaak appels met peren vergelijken. Er worden met andere gewichten geworpen of gestoten ende concurrenten zijn van hogere categorie. We zijn wel aan het kijken hoe we deze topclubrecords beter zichtbaar kunnen maken en duiden hoe deze records zich verhouden ten opzichte van oudere categorieën.</p><p>Naast al dit mooi en positieve nieuws willen we ook even stilstaan bij twee verdrietige berichten. Mien de vrouw van oud-voorzitter Harry van Hasselt is overleden. De rouwkaart hangt nog op het prikbord in de kantine.Ook is oud-bestuurslid Hans de Wijs afgelopen maand overleden. Hans heeft van 1988 tot 1995 het bestuur versterkt. We wensen de familie van Harry en Hans veel sterkte.</p><p>Als DJA hebben we samen met de Moerse Boys een verzoek bij de gemeente ingediend, om de Akkermolenweg geen doorgaand verkeer te maken na afronding van de rondweg. We willen zo min mogelijk verkeer op de Akkermolenweg, zodat onze leden er veilig kunnen fietsen.</p><p>Tot zover een update van de bestuurstafel! Dank alvast aan de leden en ouders die willen helpen rond sponsoring of andere genoemde zaken!</p><p>Niels										</p>', '2015-10-14 16:37:11'),
(8, 'Bestuursmededeling, 15-04-2015', '<p>Dag allemaal,</p><p>Zoals in&nbsp;de Algemene Ledenvergadering in februari besproken willen we jullie wat meer informeren over nieuwtjes en zaken die spelen aan de bestuurstafel.</p><p>Helaas zijn we dit jaar met onze genomineerde atleten van DJA bij het Zundertse sportgala niet in de prijzen gevallen. De foto’s van de avond staan op de site.</p><p>Het goede nieuws was op de ledenvergadering dat we geen contributieverhoging gaan doorvoeren. Mede door de complexiteit en de kosten die het nieuwe IBAN-systeem met zich meeneemt, gaan we de contributie in plaats van 2x per jaar nu 1 keer per jaar innen.</p><p>We zijn nog altijd op zoek naar mensen die wat voor de vereniging willen doen. Als jij, je ouder, je oom of tante of een bekende iets voor de club zou willen doen is men altijd welkom! Juryleden, commissieleden, kantinedames, hulp bij sponsoring of administratie u bent meer dan welkom te helpen! Functies waar we mee bezig zijn die belangrijk zijn om snel te vullen zijn vooral jeugd- en seniorentrainers, hulp bij de Wedstrijdorganisatie, hulp bij sponsoring en hulp in de kantine.</p><p>Karin van den Broek heeft zich gemeld als Vertrouwens Contact Persoon (VCP) voor de vereniging. Daar zijn we heel blij mee. Voor vertrouwelijke problemen rond personen of situaties binnen DJA waar u niet bij trainer of bestuur terecht wilt, kunt u contact met Karin opnemen.&nbsp;</p><p>Haar contactgegevens staan op deze website:&nbsp;<a href="http://www.dja-zundert.nl/infoalgemeen.html">http://www.dja-zundert.nl/infoalgemeen.html</a></p><p>In het verlengde van deze functie zijn we als bestuur aan het kijken of we voor bepaalde vrijwilligersfuncties binnen de club een Verklaring omtrent Gedrag (een VOG) willen gaan invoeren. Natuurlijk zal deze gratis zijn voor de vrijwilligers.</p><p>Dat was het weer even, bel of mail gerust bij vragen!</p><p>Het bestuur,</p><p>Anouk, Erik, Wesley, Jeanne, Niels</p>', '2015-10-14 16:37:35'),
(9, 'Van de bestuurstafel', '<p>Hoi allemaal,</p><p>Welkom op onze nieuwe website!</p><p>De oude site was ook prachtig maar als het goed is, is deze website meer up-to-date, gemakkelijker te beheren en beter geÃ¯ntegreerd met de sociale media.&nbsp; Alle informatie van de oude site staat er nog steeds op!</p><p>Onze hartelijke dank gaat uit naar RenÃ©e Vroedsteijn voor haar hulp bij het maken van de nieuwe website! Goed gedaan!! Cilia en Wesley ook bedankt voor al jullie hulp hierbij!</p><p>Wij als bestuur zijn er dan wel blij mee, maar mocht u iets missen of ergens ontevreden over zijn, laat het mij s.v.p. weten.</p><p>Naast de nieuwe website hebben we inmiddels ook WiFi op de locatie. Het WiFi-password veranderd af en toe en is te vinden op bordjes in de kantine.</p><p>Zoals je gezien hebt blijven we op zoek naar enthousiaste jeugdtrainers van binnen of buiten DJA. Heb je animo om te helpen onze jonge atleten te begeleiden laat ons s.v.p. weten. Hetzelfde geldt ook nog steeds voor de kantine. Zin om mee te draaien in de kantineploeg? Ik hoor het graag!</p><p>We zijn samen met de gemeente bezig met een herkeuring van onze baan. In de herfstvakantie wordt de baan herkeurd. We houden jullie op de hoogte van de uitkomst.</p><p>Mochten jullie afval zien op de accommodatie en je bent in de gelegenheid, pak het even op en gooi het in de vuilnisbakken. We hebben ook de Moer gevraagd na het voetballen nog even een rondje te doen op onze accommodatie om het zo schoon mogelijk te houden.</p><p>We gaan ook weer een jurycursus doen! Waarschijnlijk begin 2016. Als je zin hebt om mee te doen en ook jurylid voor DJA te worden: stuur me een bericht!</p><p>Een belangrijk volgende punt waar we als bestuur mee willen starten is het inrichten van een nieuwe sponsoringcommissie. Zoals je op de nieuwe website kunt zien, brengen we onze sponsoren meer voor het voetlicht. We willen daarnaast kijken wat we verder via activiteiten, via borden op de accommodatie en via sociale media, nog meer kunnen doen. Ik zal hier een e-mail over sturen naar alle leden waar we een e-mailadres van hebben. Mocht je interesse hebben hoor ik het graag.</p><p>De club groeit. We hebben mooie prestatie binnen alle categorieÃ«n. We hebben een hele leuke recreatieve groep, de wandeltochten zijn elke keer een geweldig succes, er begint weer een nieuwe opstapgroep, onze vrijdagploeg doet prachtig werk! Allemaal heel positief!</p><p>Bedankt allemaal voor jullie betrokkenheid bij de club!</p><p>Groetjes,</p><p>Namens het bestuur,</p><p>Niels</p><p><a href="mailto:voorzitter@dja-zundert.nl">voorzitter@dja-zundert.nl</a></p>', '2015-10-26 22:32:30'),
(10, 'Van de bestuurstafel', '<p>Dag allemaal,</p><p>Even twee mededelingen van de \r\nbestuurstafel:</p><p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\nIn juni jongstleden liep de keuring van onze atletiekbaan af. Deze \r\nmoet eens in de 3 jaar worden gekeurd. Hij is opnieuw gekeurd en op een aantal \r\npunten niet in orde bevonden. De baan is van de gemeente en de gemeente was ook \r\nbij de keuring. We zijn met de gemeente in gesprek over de planning van de \r\naanpassingen zodat we in 2016 weer een wedstrijdfitte baan hebben, wedstrijden \r\nmogen organiseren en records kunnen erkennen.</p><p>\r\n2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\nDe ARWB (http://www.regio12.nl/) is de stichting die we als West \r\nBrabantse atletiek verenigingen binnen onze zogenoemde â€œregio 12â€ &nbsp;10 jaar \r\ngeleden in het leven hebben geroepen om gezamenlijk wedstrijden te organiseren, \r\nsamen op te treden in investeringen en gezamenlijk via ons unie lidmaatschap ons \r\nbij de AU te laten horen. Jan Hereijgers, erelid van de DJA zit deze vereniging \r\nal een ruim aantal jaren voor. Naast Jan is Henk Bevelander Penningmeester en \r\nAdrie Vrolijk is recent als secretaris afgetreden om dat zijn termijnen erop \r\nzaten. </p><p>De ARWB is een \r\nbelangrijke waarde voor de atletiek in west Brabant. De ARWB heeft officieel als \r\ntaken: </p><p>\r\na. &nbsp; &nbsp; &nbsp;De wedstrijdkalender organiseren</p><p>\r\nb. &nbsp; &nbsp; &nbsp;De cross competities organiseren </p><p>\r\nc. &nbsp; &nbsp; &nbsp;Onderlinge regio- wedstrijden organiseren </p><p>\r\nd.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\nRegionale kampioenschappen jeugd organiseren </p><p>\r\ne.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\nBijhouden van de West Brabantse records</p><p>\r\nf. &nbsp; &nbsp; &nbsp; Het samenwerken op trainingsgebieden</p><p>\r\ng. &nbsp; &nbsp; &nbsp;Informatie uitwisseling en onderlinge bijstand aan \r\nelkaar</p><p>\r\nWe zijn al een tijdje \r\nnaarstig op zoek naar opvolging. De open vacature van secretaris is het meest \r\nurgent, maar komend jaar treedt ook Jan H af. Ook ziet de ARWB graag een \r\nalgemeen bestuurslid erbij. Als er niemand wordt gevonden is de kans groot dat \r\nde ARWB per april 2016 wordt opgeheven, dit staat in de statuten aangegeven. \r\nMochten er geÃ¯nteresseerden zijn die een aantal avonden per jaar tijd hebben om \r\nte helpen meldt je dan bij ons aan als je blieft. Je hoeft niet per se een \r\natletiek expert te zijn. Vraag ook aan je familieleden of ze er wellicht zin en \r\ntijd voor hebben?! </p><p>Met vriendelijke groeten,</p><p>\r\nNamens het bestuur</p><p>\r\nNiels van Namen</p>', '2015-11-17 17:56:00');
INSERT INTO `news` (`ID`, `titel`, `article`, `datum`) VALUES
(16, 'Een nieuw jasje', '<p>Na enkele maanden voorbereiding is het dan eindelijk zover: met trots presenteer ik u de geheel vernieuwde website!</p>\r\n\r\n<p>dja-zundert.nl is in een nieuw jasje gestoken. Met de overzichtelijke structuur, de activiteitenagenda, het uitgebreide  nieuwsoverzicht en andere functies die de nieuwe website bevat, blijft u goed op de hoogte van alles wat er binnen de vereniging gebeurd.</p>\r\n<p></p>\r\n<p>Veel surfplezier!<p>\r\n<p></p>\r\n<p>RenÃ©e Vroedsteijn</p>\r\n<p>Designer van de nieuwe dja-zundert.nl</p>\r\n', '2015-10-22 07:24:05'),
(19, 'Van de bestuurstafel', '<p>Hoi allemaal,</p><p>Welkom op onze nieuwe website!</p><p>De oude site was ook prachtig maar als het goed is, is\r\ndeze website meer up-to-date, gemakkelijker te beheren en beter geÃ¯ntegreerd\r\nmet de sociale media.&nbsp; Alle informatie van de oude site staat er nog\r\nsteeds op!</p><p>\r\n\r\nOnze hartelijke dank gaat uit naar RenÃ©e Vroedsteijn voor\r\nhaar hulp bij het maken van de nieuwe website! Goed gedaan!! Cilia en Wesley\r\nook bedankt voor al jullie hulp hierbij!</p><p>\r\n\r\nWij als bestuur zijn er dan wel blij mee, maar mocht u\r\niets missen of ergens ontevreden over zijn, laat het mij s.v.p. weten.</p><p>Naast de nieuwe website hebben we inmiddels ook WiFi op\r\nde locatie. Het WiFi-password veranderd af en toe en is te vinden op bordjes in\r\nde kantine.</p><p>Zoals je gezien hebt blijven we op zoek naar enthousiaste\r\njeugdtrainers van binnen of buiten DJA. Heb je animo om te helpen onze jonge\r\natleten te begeleiden laat ons s.v.p. weten. Hetzelfde geldt ook nog steeds\r\nvoor de kantine. Zin om mee te draaien in de kantineploeg? Ik hoor het graag!</p><p>We zijn samen met de gemeente bezig met een herkeuring\r\nvan onze baan. In de herfstvakantie wordt de baan herkeurd. We houden jullie op\r\nde hoogte van de uitkomst.</p><p>Mochten jullie afval zien op de accommodatie en je bent\r\nin de gelegenheid, pak het even op en gooi het in de vuilnisbakken. We hebben\r\nook de Moer gevraagd na het voetballen nog even een rondje te doen op onze\r\naccommodatie om het zo schoon mogelijk te houden.</p><p>We gaan ook weer een jurycursus doen! Waarschijnlijk\r\nbegin 2016. Als je zin hebt om mee te doen en ook jurylid voor DJA te worden:\r\nstuur me een bericht!</p><p>Een belangrijk volgende punt waar we als bestuur mee\r\nwillen starten is het inrichten van een nieuwe sponsoringcommissie. Zoals je op\r\nde nieuwe website kunt zien, brengen we onze sponsoren meer voor het voetlicht.\r\nWe willen daarnaast kijken wat we verder via activiteiten, via borden op de\r\naccommodatie en via sociale media, nog meer kunnen doen. Ik zal hier een e-mail\r\nover sturen naar alle leden waar we een e-mailadres van hebben. Mocht je\r\ninteresse hebben hoor ik het graag.</p><p>De club groeit. We hebben mooie prestatie binnen alle categorieÃ«n.\r\nWe hebben een hele leuke recreatieve groep, de wandeltochten zijn elke keer een\r\ngeweldig succes, er begint weer een nieuwe opstapgroep, onze vrijdagploeg doet\r\nprachtig werk! Allemaal heel positief!</p><p>Bedankt allemaal voor jullie betrokkenheid bij de club!</p><p>Groetjes,</p><p>\r\n\r\nNamens het bestuur,</p><p>Niels</p><p><a href="mailto:voorzitter@dja-zundert.nl">voorzitter@dja-zundert.nl</a></p>', '2015-10-23 18:35:29'),
