(27, 'DJA is op zoek naar erelid Jan de Bruin', '<p>Jan de Bruin is sinds 1977 erelid van DJA. Hij ontbreekt op de foto van alle ereleden. Weet iemand waar hij is te vinden? Graag doorgeven aan Niels van Namen (voorzitter@dja-zundert.nl).</p>', '2015-11-03 15:02:45'),
(30, 'Zaterdag 28 november indoor dja', '<b>Zaterdag 28 november Indoor DJA (alleen voor eigen jeugdleden). Geef je snel op bij je trainer!</b>', '2015-11-12 06:21:22'),
(32, 'Van de bestuurstafel', '<p>Dag allemaal,</p><p>Even twee mededelingen van de bestuurstafel:</p><p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In juni jongstleden liep de keuring van onze atletiekbaan af. Deze moet eens in de 3 jaar worden gekeurd. Hij is opnieuw gekeurd en op een aantal punten niet in orde bevonden. De baan is van de gemeente en de gemeente was ook bij de keuring. We zijn met de gemeente in gesprek over de planning van de aanpassingen zodat we in 2016 weer een wedstrijdfitte baan hebben, wedstrijden mogen organiseren en records kunnen erkennen.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; De ARWB (http://www.regio12.nl/) is de stichting die we als West Brabantse atletiek verenigingen binnen onze zogenoemde â€œregio 12â€ &nbsp;10 jaar geleden in het leven hebben geroepen om gezamenlijk wedstrijden te organiseren, samen op te treden in investeringen en gezamenlijk via ons unie lidmaatschap ons bij de AU te laten horen. Jan Hereijgers, erelid van de DJA zit deze vereniging al een ruim aantal jaren voor. Naast Jan is Henk Bevelander Penningmeester en Adrie Vrolijk is recent als secretaris afgetreden om dat zijn termijnen erop zaten.</p><p>De ARWB is een belangrijke waarde voor de atletiek in west Brabant. De ARWB heeft officieel als taken:</p><p>a. &nbsp; &nbsp; &nbsp;De wedstrijdkalender organiseren</p><p>b. &nbsp; &nbsp; &nbsp;De cross competities organiseren</p><p>c. &nbsp; &nbsp; &nbsp;Onderlinge regio- wedstrijden organiseren</p><p>d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Regionale kampioenschappen jeugd organiseren</p><p>e.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bijhouden van de West Brabantse records</p><p>f. &nbsp; &nbsp; &nbsp; Het samenwerken op trainingsgebieden</p><p>g. &nbsp; &nbsp; &nbsp;Informatie uitwisseling en onderlinge bijstand aan elkaar</p><p>We zijn al een tijdje naarstig op zoek naar opvolging. De open vacature van secretaris is het meest urgent, maar komend jaar treedt ook Jan H af. Ook ziet de ARWB graag een algemeen bestuurslid erbij. Als er niemand wordt gevonden is de kans groot dat de ARWB per april 2016 wordt opgeheven, dit staat in de statuten aangegeven. Mochten er geÃ¯nteresseerden zijn die een aantal avonden per jaar tijd hebben om te helpen meldt je dan bij ons aan als je blieft. Je hoeft niet per se een atletiek expert te zijn. Vraag ook aan je familieleden of ze er wellicht zin en tijd voor hebben?!</p><p>Met vriendelijke groeten,</p><p>Namens het bestuur</p><p>Niels van Namen</p>', '2015-11-17 17:56:53'),
