INSERT INTO `text_reports` (`ID`, `titel`, `tekst`, `datum`) VALUES
(10, 'ARWB Cross Diomedon 1 november (junioren)', '<p>Het cross seizoen is weer begonnen. De openingswedstrijd werd, net als vorig jaar, door Diomedon georganiseerd. Het was stralend weer en veel warmer dan we gewend zijn tijdens een cross.</p><p>Het eerste startschot van de dag werd gegeven voor de C-meisjes Bowien, Sophie en Mirte. <b>Bowien </b>bleek een erg goede tempomaker voor <b>Mirte</b>, die voor het eerst een wedstrijd als C-junior deed. Beiden dames deden hun uiterste best en gaven alles. Bowien eindigde als 11e en nog geen halve seconde later kwam Mirte over de finish (12e). Dat <b>Sophie </b>een sterk zomerseizoen heeft gedraaid op de loopafstanden werd vandaag al meteen duidelijk. Waar ze vorig jaar genoegen moest nemen met een vijfde plaats in het eindklassement, ging ze nu als eerste van start. Helaas moest ze de koppositie op een gegeven moment afgeven, maar Sophie finishte knap als tweede!</p><p>Bij de C-jongens werd de tweede podiumplaats in de wacht gesleept door <b>Menno</b>. Hij legde de 2265 meter in razendsnel tempo af en kwam als derde over de finish. Maar misschien zit er de volgende keer nog wel iets meer in, aangezien de achterstand op nummer twee erg klein was. Maar ook hier een mooie vooruitgang voor Menno. Waar hij vorig jaar nog 8:51 minuten deed over dit parcours waren het er nu slechts 8:16 minuten! Ook vooruitgang voor <b>Sam</b>. Niet qua plaats, want hij werd net als vorig jaar zevende. Maar wel qua tijd: een mooie zes seconden sneller.</p><p>Bij de D-junioren meisjes waren <b>Evi</b> en <b>Aniek </b>met elkaar in een strijd verwikkeld. Het bleek een erg spannende wedstrijd. Vorig jaar was het nog Aniek die deze tweestrijd meestal won, maar nu was het de beurt aan Evi. Met een kleine voorsprong kwam zij als 14e over de finish, even later dus gevolgd door Aniek (16e).</p><p>Bij de D-junioren maakte <b>Jamile </b>zeer grote indruk. Hij ging als een speer van start, wellicht iets te hard maar zeker erg gedurfd. En dat betaalde zich uit in een prachtige vierde plaats. Als hij volgende keer zijn race iets beter indeelt, wordt hij zeker derde. Dat scheelde vandaag slechts een halve seconde. Slechts 5 seconden na Jamile kwam <b>Youri </b>over de streep. Een uitstekende prestatie, want dit was pas zijn eerste wedstrijd als junior.&nbsp;</p><p>In de middag was het de beurt aan de oudere junioren. Om half 1 klonk het startschot voor de meisjes. Zowel bij de B-junioren als A-junioren stonden er twee DJA atletes op het podium. Bij de B-junioren was er een tweede plaats voor <b>Fleur </b>die haar race goed indeelde. Even later kwam <b>Eva </b>als derde over de streep, die in haar eerste atletiekwedstrijd ooit meteen al een podiumplaats veroverde. <b>Suzanne </b>viel net buiten het podium en finishte als vierde. A-juniore <b>Manon </b>werd, mede dankzij haar snelle start, tweede. Zus <b>Sanne</b> werd derde. Bij de jongens was er de winst voor B-junior <b>Joris</b>. Een geweldig begin van de competitie voor Joris, die vorig jaar nipt het podium miste in het eindklassement met een vierde plek.&nbsp;</p>', '2015-11-09 22:08:50'),
(11, 'ARWB Cross Diomedon 1 november (pupillen)', '<p><b>We zijn weer begonnen!</b></p><p>Na een hele maand zonder wedstrijden, is de honger bij de pupillen langzaam gegroeid. Weliswaar is er lekker getraind, maar zijn de atleetjes toe aan een wedstrijd om weer eens te kunnen laten zien wat ze kunnen.</p><p>De Diomedon-cross is vandaag het toneel voor de eerste krachtmeting van deze winter.</p><p>DJA levert deelnemers in alle categorieÃ«n, dus van mini-pupil tot A-pupil, zowel jongens als meisjes! En ze hebben het allemaal erg goed gedaan, de Ã©Ã©n zelfs nog beter dan de ander, met ook vandaag een aantal ereplaatsen!</p><p><b>Een snel rondje:</b></p><p><ul><li>Floor is er voor het eerst bij. Deze mini-pupil heeft er duidelijk zin in en finisht als snelste meisje!</li><li>Ook bij de jongens een mini-pupil en ook daar niet de minste: Jurre loopt zich net als Floor naar een podiumklassering.</li><li>Ook bij de C-meisjes zien we een debutante in de persoon van Amy. Deze kleine meid moet nog een beetje wennen, maar kan terugkijken op een knappe eerste wedstrijd!</li><li>De laatste debutant strijd bij de C-jongens. Jelle staat hier samen met Karsten aan de start. Beide mannen lopen zich in de top zes! Kanjers!</li><li>Milou heeft het wat zwaarder in het grote deelnemersveld met jongens en meisjes B-pupillen. Het geweld van de snelle jongens maakt indruk, maar ondanks dat heeft Milou een keurige race gelopen.</li><li>Bij de jongens B-pupillen hebben we een arsenaal aan toppers aan de start. Achtereenvolgens eindigen Aiden, Jim, Tobias, Quinten en Niels op de plaatsen 2 t/m 6. Een indrukwekkende prestatie en doelstelling om de volgende keer te herhalen. Bovendien willen we dan ook Bram terug zien in dit rijtje. Dit keer had hij het wat zwaarder en moest bij de start al snel het onderspit delven tussen de grotere jongens. Bovendien verstapte hij zich, wat de race er ook niet makkelijker op maakte.</li><li>Anouk loopt een mooie race bij de A-meisjes en eindigt als tweede. De concurrentie is duidelijk sterker geworden, wat een lastig jaar kan betekenen voor onze loopster. We gaan er dus aan werken om een vloeiendere loop te ontwikkelen.</li><li>Net als de jongens B-pupillen, hebben ook onze A-jongens heel veel indruk gemaakt. Bart gelooft eindelijk in zichzelf en zet zijn grote motor, fluwelen looptechniek en watervlugge benen om in een gouden race. Daan voert van begin tot eind de wedstrijd aan, slaat onderweg een aanval van een concurrent af, maar moet de winst aan Bart laten. Voor deze 1e jaars A-pupil is dat prima. Hij mag meer dan trots zijn op een fantastische race.</li><li>Joey loopt ook een stuk sneller dan vorig jaar, maar kan nog steeds stukken sneller. De winst zit voor deze pupil in een krachtigere loop, met wat meer paslengte. Ook daar gaan we aan werken!</li><li>Ruben overtreft zichzelf. Deze pupil wordt steeds ervarener en leert zijn race beter in te delen, wat hem vandaag een knap resultaat oplevert.</li></ul></p><p>Het groen-wit hebben we weer veelvuldig vooraan kunnen zien, met een aantal podiumplaatsen. De overmacht van onze B-jongens (met helaas nog geen 1e plaats) en de dominantie van de A-jongens leverde prachtige wedstrijden op.</p><p>Conclusie: de eerste cross van deze winter was top!</p><p>Groeten,</p><p>Jeroen</p>', '2015-11-09 23:10:17'),
(19, 'ARWB Cross AVS''90 22 november (junioren)', '<p>De tweede ARWB cross van het seizoen werd gehouden door AVSâ€™90 te Standdaarbuiten. De cross staat erom bekend erg modderig te zijn als het geregend heeft. En aangezien het heel de week geregend had, betekende dat een loodzwaar parcours voor de deelnemers.</p><p>Wederom was het aan de C-meisjes om de dag te openen. En wederom stonden daar Sophie, Bowien en Mirte aan de start, ditmaal versterkt door <b>Ankie</b>. Het modderige en loodzware parcours lag Ankie niet echt en ze was al snel uitgeput. Toch finishte ze mooi halverwege het veld als 11e. Ook voor <b>Bowien </b>bleek het een lastig parcours. Ze moest helaas halverwege opgeven, nadat ze op een boomstronk stapte en haar knie blesseerde. <b>Mirte </b>heeft al een tijdje last van haar enkel. De ongelijke ondergrond is dan niet ideaal. Toch liep ze de cross helemaal uit en finishte als 16e. <b>Sophie </b>had ook vandaag weer weinig problemen om de tweede plaats veilig te stellen. In een ontspannen pas verstrekte ze vandaag haar klassementspositie.&nbsp;</p><p>Bij de C-jongens was het <b>Menno </b>die zich vooraan in het veld meldde. De race verliep nog niet helemaal optimaal en het gat met de top drie was iets groter dan gehoopt. Toch mag hij tevreden zijn met de vierde plaats, die hij door middel van een goede eindsprint binnen sleepte. <b>Siem </b>miste de eerste cross, maar was vandaag weer present. Zijn loopstijl is in een jaar zeker vooruit gegaan en hij eindigde als 14e in zijn eerste wedstrijd als C-junior.</p><p>Vier D-meisjes van DJA liepen vervolgens hun cross. <b>Tessa</b>â€™s optreden was erg indrukwekkend. Haar techniek is geweldig vooruitgegaan. In een zeer soepele en ontspannen tred legde ze de 1600 meter maar liefst 24 seconden sneller af dan nummer twee. Er zat zelfs nog een eindsprintje in en nog steeds leek ze niet moe. Super! Voor <b>Tess </b>en <b>Indy </b>was het de eerste cross van het seizoen. Waar Indy vorig jaar steeds voor Tess finishte, was het nu andersom. Tess eindigde als 20e en Indy als 23e. Vlak achter Indy finishte <b>Aniek </b>als 24e.</p><p>Bij de D-junioren ging <b>Jamile </b>wat voorzichtiger van start vandaag. Misschien wel iets te voorzichtig, want hij leek nog veel over te hebben aan het einde. Met een negende plaats eindigde hij nog mooi in de top 10. Slechts enkele seconden na Jamile kwam <b>Youri</b> over de streep. Ook voor hem dus alweer een top 10 klassering. Voor <b>Daan </b>was het zijn eerste wedstrijd ooit. Hij liep een prima wedstrijd en eindigde als twaalfde.&nbsp;</p><p>Nadat de pupillen hadden gelopen, met enkele zeer mooie prestaties, was het de beurt aan de oudere junioren. De dames moesten een stuk verder lopen dan tijdens de eerste cross. <b>Suzanne </b>hield ruim twee kilometer lang de vierde plek vast, maar kwam na drie kilometer toch als vijfde over de streep. Bij de A-junioren was het <b>Sanne </b>die geen probleem had met 4 kilometer. Ze kwam dan ook als eerste over de finish. Bij de jongens liep <b>Olivier </b>ontspannen naar een vierde plaats. <b>Joris </b>legde de 4 kilometer als snelste af en pakte de eerste plaats, net zoals zijn jongere zus al eerder op de dag deed.&nbsp;</p>', '2015-11-29 19:46:57');
